const router = require("express").Router()
import getAuthToken from "./utils/getAuthToken"
import usersController from "./modules/users/controller"
import passport from "passport"

const login = (req, res, next) => {
  const {
    user: { id: userId }
  } = req

  res
    .cookie("jwt", `${getAuthToken(userId)}`, {
      maxAge: 24 * 60 * 60,
      httpOnly: true
    })
    .json({ message: `You are logged in as ${user.username}` })
  res.status(200)
  next()
}

const logout = (req, res, next) => {
  //we will logout no matter what as an escape hatch
  res.clearCookie("jwt")
  next()
}

const signup = async (req, res, next) => {
  const { username, password } = req.body
  if (!username || !password) {
    res.json({
      isFailed: true,
      message: "please, provide username and password"
    })
  } else {
    try {
      const user = await usersController()._add({ username, password })
      res.json({
        message: "account created, dont forget to login and complete profile"
      })
    } catch (e) {
      res.json({ isFailed: true, message: e.message })
    }
  }
  res.status(200)
  next()
}

router.post("/login", passport.authenticate("login", { session: false }), login)
router.post("/logout", passport.authenticate("jwt", { session: false }), logout)
router.post("/signup", signup)

export default router

